import React, {useState, useEffect} from "react";
import { Link } from "react-router-dom";

import useDocumentTitle from "../useDocumentTitle";

import "./pages.css";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faBackwardStep, faCaretLeft, faCaretRight, faForwardStep, faHeart, faMoon, faPause, faPlay, faScaleBalanced, faSun, faUser } from "@fortawesome/free-solid-svg-icons";

function Pages(props) {
  const [page, setPage] = useState(1);
  const [mode, setMode] = useState(0);

  useDocumentTitle(`${props.title}`);

  return (
    <div className="container">
      <div className="wave">
        <div style={{backgroundImage: URL('../assets/images/wave_1.png')}} id="wave-1" ></div>
        <div style={{backgroundImage: URL('../assets/images/wave_2.png')}} id="wave-2" ></div>
        <div style={{backgroundImage: URL('../assets/images/wave_3.png')}} id="wave-3" ></div>
      </div>
    </div>
  );
}

export default Pages;
